const NumbersControl = (props) => 
{
    const generateNumber = () => 
    {
        const randomNumber = Math.random() * 100
        console.log(randomNumber)
    }

    return(
        <div>
            <button onClick={generateNumber}>Generate</button>{" "}
            <button>+ 2</button>{" "}
            <button>Remove All</button>{" "}
        </div>
    )
}
